package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class UploadPhotoResponse(	@field:SerializedName("data")	val data: List<String>,	@field:SerializedName("meta")	val meta: MetaPhoto)data class MetaPhoto(	@field:SerializedName("code")	val code: Int,	@field:SerializedName("message")	val message: String,	@field:SerializedName("status")	val status: String)